function packEntities(entities) {
    let buffer = new ArrayBuffer(entities.length * 7);
    let view = new DataView(buffer);
    for (let i = 0; i < entities.length; i++) {
        let entity = entities[i];
        view.setUint8(i * 7, (entity.id << 3) | entity.size);
    }
    return buffer;
}

function unpackEntities(buffer) {
    let view = new DataView(buffer);
    let entities = [];
    for (let i = 0; i < buffer.byteLength; i += 7) {
        let id = view.getUint8(i) >> 3;
        let size = view.getUint8(i) & 0b111;
        entities.push({ id, size });
    }
    return entities;
}
```

